campaignTrail_temp.answers_json = [
    {
        "model": "campaign_trail.answer",
        "pk": 4174,
        "fields": {
            "question": 630,
            "description": "My fellow animals, I am the conservative change that Naturia needs. I will protect our national values, I will protect us from outsiders, and I will fix all of our problems. These paws will bring change! "
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4175,
        "fields": {
            "question": 630,
            "description": "Together, we will destroy the leftist government that plagues our great nation. We will show the world that Naturia is for the Naturians, that we animals are a free multitide that shall not be troubled by the masses of outsiders, and we patriots, whether furry, feathered, or anything else, will raise our banner high! Naturia for the Naturians!"
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4176,
        "fields": {
            "question": 630,
            "description": "Naturia is unique. We are free, united, and strong. But we are plagued by issues, by disturbances, by incompetence. I am running for President to change that. Join me, and we'll cast out Together We Do More and make Naturia great again!"
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4205,
        "fields": {
            "question": 641,
            "description": "Let's not give them so much fuel. Keep this as a two-way race."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4206,
        "fields": {
            "question": 641,
            "description": "Let's go and attack the Alternative. They are so radicals, and we need to differentiate with them."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4210,
        "fields": {
            "question": 643,
            "description": "I support a more traditional infrastructure style. Only a few changes and it's okay for the animals and plants living here."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4211,
        "fields": {
            "question": 643,
            "description": "Absolutely not. Keep the traditional architecture! Let this rusty barn in their location!"
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4212,
        "fields": {
            "question": 643,
            "description": "Let's bring strength and prosperity to our country with new models."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4213,
        "fields": {
            "question": 644,
            "description": "I support our current naturalization laws as they stand."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4214,
        "fields": {
            "question": 644,
            "description": "I stand for creating minor changes, like increasing the waiting period before new citizens may vote. We must ensure that the rights of those who have been here for a long time are protected, but we also must be careful not to act harshly towards those in search of a new home."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4215,
        "fields": {
            "question": 644,
            "description": "Our current laws are in need of great revision, in light of the troubles we have had with recent immigrants. We must drastically extend the waiting period for new arrivals, and before we allow them in as full citizens they are to be given preliminary status."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4216,
        "fields": {
            "question": 645,
            "description": "I support some stances like give them basic rights, b ut that's not our focus this election."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4217,
        "fields": {
            "question": 645,
            "description": "Of course! There's a lot we could do to improve their life quality."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4218,
        "fields": {
            "question": 645,
            "description": "Not at all. They already have what they want."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4220,
        "fields": {
            "question": 646,
            "description": "We must renew all the current leftist government, pushing it to the right. Free market and get rid of these social programs."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4221,
        "fields": {
            "question": 646,
            "description": "Let's use my paws to bring change to Naturia. People are exhausted of many leftist administrations. Let's criticize it!"
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4224,
        "fields": {
            "question": 648,
            "description": "I firmly believe in an isolationist policy. Let's keep it as one of our main proposals."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4225,
        "fields": {
            "question": 648,
            "description": "We think a more aggresive policy would fit great for our glorious nation."
        }
    },
    {
        "model": "campaign_trail.answer",
        "pk": 4228,
        "fields": {
            "question": 649,
            "description": " We need to be just as aggressive on this issue as we are anywhere else. We need to expand our nation to all neighboring land, and we need to do it now. My administration will set loose the dogs of war upon all who refuse to concede to us our due!"

    },

        "fields": {

    },

        "pk": 4230,

            "description": " I support annexation of the garden but not of the sidewalk. The reason for this is that the sidewalk would be difficult to occupy and keep safe, given the massive quantites of visitors and guests that regularly traverse it. The garden, meanwhile, is a far less eventful location."

        "fields": {

            "description": "Regardless of our personal feelings, a lack of an Army to defend our land it's always concerning. Let's establish it!"
